import React from 'react';
import styled from "styled-components";

export const LoginContainer = styled.div`
  display: flex;
  flex-direction: column;
  /* justify-content: center; */
  align-items: center;
  text-align: center;
  width: 360px;
  height: 90%;
  border-radius: 30px;
  background-color: #f9f9f9;
  box-shadow: 0px 0px 20px #d5d5d5;
  padding: 2px; 
  position: fixed;
  bottom: 0;
`;

export const LoginTitle = styled.div`
  margin-top: 40px;
  color : #636363;
  font-family: Nanum Barun Gothic;
  font-size : 40px;
  font-weight: bold;
`;

export const LoginIdInputContainer = styled.div`
  width: 240px;
  height: 50px;
  border-radius: 20px;
  border: 2px solid #eeeeee;;
  /* box-shadow: 0px 0px 10px #e8e7e7; */
  background-color: #f9f9f9;
  padding: 2px; 
  margin: 15px;
  display: flex;
  align-items: center;
  justify-content: center;

`;
export const LoginIdInput = styled.input`
  width: 80%;
  height: 60%;
  border: none;
  background-color: #f9f9f9;
  line-height: 50px;
  text-align: left;
  color : #cdcdcd;
  font-family: Nanum Barun Gothic;
  font-size : 15px;
  font-weight: bold;
  outline: none;
  ::placeholder {color: #cdcdcd;}
  /* input:focus {outline:none;} */
`;

const Login = () => {
  return (
    <LoginContainer>
      <LoginTitle>LOGIN</LoginTitle>
      <LoginIdInputContainer><LoginIdInput placeholder='아이디를 입력하세요'></LoginIdInput></LoginIdInputContainer>
    </LoginContainer>
  );
};

export default Login;
